INSERT INTO `news` VALUES (3,"Avec une très bonne connaissance, je lance le projet. On en parle, pose des idées et la structure. De cette époque, une grosse partie a été laissé de coté ou a changé. Depuis, j\'ai (Kaien) continué quasiment seul (mon camarade donne des micro coups de pouces de temps à autre en plus d\'une seconde personne (affirmation de 2020)).","Idée du projet.","2012-08-17 16:13:23"),
(4,"Je travaille sur une version 1 du site. Cependant, lors d\'un changement de PC, j\'ai perdu tout le travail faute de sauvegarde du travail.\r\nCette première version n\'avait que très très peu de gameplay. C\'était plus un entrainement qu\'un projet vraiment avancé.","Version 1 du site","2016-07-01 16:13:25"),
(5,"Je me lance sérieusement sur le site. J\'arrive à travailler 1 heure par jour pendant 2-3 mois posant quelques bases du site.","Début du travail sur la version 2","2019-09-01 16:13:27"),
(6,"Cet été, un gros travail est fait pour faire avancer ce projet. Ces derniers jours, plusieurs mécaniques ont été ajoutés : Combats planétaires, rapports de combats, forum, news du site.\r\nJ\'espère lancer l\'alpha dans l\'année (faut que je revois cette news dans quelques années :))","Préparation de l\'alpha","2020-08-19 22:38:51");
